import { useState } from "react";
import { RulesetWrapper } from "./RulesetEngine.styles";

type Props = {};

const RulesetEngine = (props: Props) => {
  const [rules, setRules] = useState<{ id: string }[]>([]);
  setRules([{ id: "hello" }]);
  return (
    <RulesetWrapper>
      <h4>RulesetEngine</h4>
      <p>{rules.length}</p>
    </RulesetWrapper>
  );
};

export default RulesetEngine;
